import React from 'react'
import Input from '../Input/Input'
import { MdClose } from 'react-icons/md'
import './Modal.css'

function Modal(props) {
    return (
        <section className="modal-main">
            <div className="modal-nomadi">
                <button className="button-close">
                    <MdClose />
                </button> 
                <h3>{props.h3}</h3>
                <h5>{props.h5}</h5>
                {campos.map((props) => {
                    return (
                        <form>
                            <Input
                                    htmlFor={props.htmlFor}
                                    id={props.id}
                                    type={props.type}
                                    name={props.name} />
                            <label htmlFor={props.htmlFor} children={props.children} />
                        </form>
                    )
                })}
            </div>
        </section>
    )
}
export default Modal
